def countTriplets(arr, r):
    num_occ = {}
    for i, num in enumerate(arr):
        if num in num_occ:
            num_occ[num].append(i)
        else:
            num_occ[num] = [i]
    # print(num_occ)
    triplets = 0
    for num in num_occ:
        num_1 = num * r
        num_2 = num * (r ** 2)
        if num_1 in num_occ and num_2 in num_occ:
            # print('found')
            for index0 in num_occ[num]:
                # find index of first index bigger than index0
                pos = len(num_occ[num_1])
                for n in num_occ[num_1]:
                    if index0 < n:
                        pos = n
                        break
                # print(pos)
                bigger_index_nums = num_occ[num_1][pos:]#(x for x in num_occ[num_1] if x > index0)
                # print(bigger_index_nums)
                for index1 in bigger_index_nums:
                    pos = len(num_occ[num_2])
                    for n in num_occ[num_2]:
                        if index1 < n:
                            pos = n
                            break
                    bigger_bigger_index_nums = num_occ[num_2][pos:]#[x for x in num_occ[num_2] if x > index1]
                    triplets += len(bigger_bigger_index_nums)
                    # triplets += sum(i > index2 for i in num_occ[num_2])
    return triplets


